import styled from "styled-components";

const NewInput = () => {
  return (
    <Wrapper>
      <Input placeholder="할일 입력..." />
      <Button>추가</Button>
    </Wrapper>
  );
};
export default NewInput;

const Input = styled.input`
  width: 500px;
  height: 30px;
  background-color: #dbdbdb;
  border: none;
`;

const Button = styled.button`
  width: 50px;
  height: 30px;
`;

const Wrapper = styled.div`
  display: flex;
`;
